import React from "react";
import "./musiclist.css";

const MusicList = () => {
    const aptUrl = process.env.REACT_APP_API_URL;
    const { data, loading, error } = useFetch(`${aptUrl}/hotels?featured=true&limit=4`);
  
    return (
        <div className="pList">
            {loading ? (
                "loading"
            ) : (
                <>
                    {data &&
                        images.map((img, i) => (
                            <div className="pListItem" key={i}>
                                <img src={img} alt="" className="pListImg" />
                                <div className="pListTitles">
                                    <h1>{data[i]?.type}</h1>
                                    <h2>
                                        {data[i]?.count} {data[i]?.type}
                                    </h2>
                                </div>
                            </div>
                        ))}
                </>
            )}
        </div>
    );
};

export default MusicList;
